    return (
        <div id={ "home" }>
            <Header siteName={ "Kurzy" } />

            <div className={ "title-div" }>
                <Top />
                <h1 className={ "secondary-title" } id={ "title" }>Kontakt na organiz√°ciu</h1>
            </div>

            <Contact contactPlatform={ "Instagram" } contactName={ "@danielsvitan" }
                     contactImage={ "https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_" +
                     "2016.svg/1200px-Instagram_logo_2016.svg.png" } />
        </div>
    )
}

export { Contacts };
